import React from 'react';

const GetStarted = ({ onGetStarted }) => {
  return (
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      minHeight: '60vh',
      textAlign: 'center',
      padding: '40px 20px',
      backgroundColor: '#f8f9fa'
    }}>
      <div style={{ marginBottom: '30px' }}>
        <img src="/logo.svg" alt="Football Coach AI" width={120} height={120} />
      </div>

      <h1 style={{
        fontSize: '2.5rem',
        fontWeight: 'bold',
        color: '#000',
        marginBottom: '20px',
        fontFamily: 'Arial, sans-serif'
      }}>
        Football Coach AI
      </h1>

      <p style={{
        fontSize: '1.2rem',
        color: '#666',
        marginBottom: '40px',
        maxWidth: '600px',
        lineHeight: '1.6'
      }}>
        Upload your football match videos and get AI-powered analysis with player detection, 
        event tracking, and detailed statistics to improve your team's performance.
      </p>

      <button
        onClick={onGetStarted}
        style={{
          backgroundColor: '#007bff',
          color: 'white',
          border: 'none',
          padding: '15px 30px',
          fontSize: '1.1rem',
          fontWeight: 'bold',
          borderRadius: '8px',
          cursor: 'pointer',
          transition: 'all 0.3s ease',
          boxShadow: '0 2px 4px rgba(0,123,255,0.3)'
        }}
        onMouseOver={(e) => {
          e.target.style.backgroundColor = '#0056b3';
          e.target.style.transform = 'translateY(-2px)';
          e.target.style.boxShadow = '0 4px 8px rgba(0,123,255,0.4)';
        }}
        onMouseOut={(e) => {
          e.target.style.backgroundColor = '#007bff';
          e.target.style.transform = 'translateY(0px)';
          e.target.style.boxShadow = '0 2px 4px rgba(0,123,255,0.3)';
        }}
      >
        Get Started
      </button>

      <div style={{
        marginTop: '50px',
        display: 'flex',
        justifyContent: 'space-around',
        maxWidth: '600px',
        width: '100%'
      }}>
        <div style={{ textAlign: 'center', flex: 1 }}>
          <div style={{ fontSize: '2rem', marginBottom: '10px' }}>🎥</div>
          <h3 style={{ color: '#000', fontSize: '1rem', marginBottom: '5px' }}>Upload Videos</h3>
          <p style={{ color: '#666', fontSize: '0.9rem' }}>Upload match footage</p>
        </div>
        <div style={{ textAlign: 'center', flex: 1 }}>
          <div style={{ fontSize: '2rem', marginBottom: '10px' }}>🤖</div>
          <h3 style={{ color: '#000', fontSize: '1rem', marginBottom: '5px' }}>AI Analysis</h3>
          <p style={{ color: '#666', fontSize: '0.9rem' }}>Detect players & events</p>
        </div>
        <div style={{ textAlign: 'center', flex: 1 }}>
          <div style={{ fontSize: '2rem', marginBottom: '10px' }}>📊</div>
          <h3 style={{ color: '#000', fontSize: '1rem', marginBottom: '5px' }}>Get Stats</h3>
          <p style={{ color: '#666', fontSize: '0.9rem' }}>View detailed insights</p>
        </div>
      </div>
    </div>
  );
};

export default GetStarted;
